import"./app.d36d7bad.js";const t='{"title":"\u5728 SublimeText \u4E2D\u4F7F\u7528 Gist","description":"","frontmatter":{"date":"2014-11-08T12:07:43.000Z","tags":["sublime-text","gist"]},"headers":[{"level":2,"title":"\u9996\u5148\u4F7F\u7528Package Control\u5B89\u88C5Gist\u63D2\u4EF6","slug":"\u9996\u5148\u4F7F\u7528package-control\u5B89\u88C5gist\u63D2\u4EF6"},{"level":2,"title":"\u5728Github\u4E2D\u521B\u5EFAToken","slug":"\u5728github\u4E2D\u521B\u5EFAtoken"},{"level":2,"title":"\u4FEE\u6539Gist\u63D2\u4EF6\u914D\u7F6E","slug":"\u4FEE\u6539gist\u63D2\u4EF6\u914D\u7F6E"},{"level":2,"title":"\u5176\u5B83\u914D\u7F6E\u9879\u542B\u4E49","slug":"\u5176\u5B83\u914D\u7F6E\u9879\u542B\u4E49"},{"level":2,"title":"\u5FEB\u6377\u952E&\u529F\u80FD","slug":"\u5FEB\u6377\u952E-\u529F\u80FD"},{"level":3,"title":"\u521B\u5EFAGist","slug":"\u521B\u5EFAgist"},{"level":3,"title":"\u6DFB\u52A0\u6587\u4EF6\u5230Gist","slug":"\u6DFB\u52A0\u6587\u4EF6\u5230gist"},{"level":3,"title":"\u4F7F\u7528Gist","slug":"\u4F7F\u7528gist"},{"level":3,"title":"\u6253\u5F00Gist","slug":"\u6253\u5F00gist"},{"level":3,"title":"\u7F16\u8F91\u5220\u9664Gist","slug":"\u7F16\u8F91\u5220\u9664gist"},{"level":3,"title":"\u9875\u9762\u811A\u672C\u5F15\u7528","slug":"\u9875\u9762\u811A\u672C\u5F15\u7528"}],"relativePath":"blog/2014-11-08-gist.md","createTime":1649686573000,"lastUpdated":1647786576000}';var o=()=>`<h1 id="\u5728-sublimetext-\u4E2D\u4F7F\u7528-gist" tabindex="-1">\u5728 SublimeText \u4E2D\u4F7F\u7528 Gist <a class="header-anchor" href="#\u5728-sublimetext-\u4E2D\u4F7F\u7528-gist" aria-hidden="true">#</a></h1>
<blockquote>
<p><code>Gist</code>\u5C31\u662F\u4E00\u4E2A\u5728\u7EBF\u7684<code>Snippets</code>\u7BA1\u7406\u5668,\u5E76\u4E14\u62E5\u6709\u7248\u672C\u63A7\u5236\u529F\u80FD.\u55EF,\u603B\u800C\u8A00\u4E4B,\u9AD8\u5927\u4E0A&amp;\u53FC~(\u5927\u6982\u5427~~)</p>
</blockquote>
<h2 id="\u9996\u5148\u4F7F\u7528package-control\u5B89\u88C5gist\u63D2\u4EF6" tabindex="-1">\u9996\u5148\u4F7F\u7528<code>Package Control</code>\u5B89\u88C5<code>Gist</code>\u63D2\u4EF6 <a class="header-anchor" href="#\u9996\u5148\u4F7F\u7528package-control\u5B89\u88C5gist\u63D2\u4EF6" aria-hidden="true">#</a></h2>
<p>\u4F7F\u7528<code>Ctrl+Shift+P</code>\u6253\u5F00\u547D\u4EE4\u5DE5\u5177,\u6267\u884C<code>Install Package</code>\u64CD\u4F5C,\u8F93\u5165<code>Gist</code>\u67E5\u627E\u63D2\u4EF6\u5E76\u5B89\u88C5</p>
<h2 id="\u5728github\u4E2D\u521B\u5EFAtoken" tabindex="-1">\u5728<code>Github</code>\u4E2D\u521B\u5EFA<code>Token</code> <a class="header-anchor" href="#\u5728github\u4E2D\u521B\u5EFAtoken" aria-hidden="true">#</a></h2>
<p>\u5728<code>Github</code>\u4E2D\u521B\u5EFA\u4E00\u4E2A<code>Token</code>:\u70B9\u51FB\u53F3\u4E0A\u89D2<code>Settings</code>\u6309\u94AE\u8FDB\u5165<code>Personal settings</code>\u83DC\u5355,\u9009\u62E9<code>Applications</code>,\u70B9\u51FB<code>Personal access tokens</code>\u540E\u7684<code>Generate new token</code>\u6309\u94AE\u521B\u5EFA\u4E00\u4E2A\u65B0<code>Token</code>,\u5728\u4E0B\u65B9\u9009\u9879\u4E2D\u52FE\u9009<code>gist</code>\u9879,\u7136\u540E\u521B\u5EFA.\u82E5\u662F\u6709\u7B26\u5408\u6761\u4EF6\u7684<code>Token</code>\u4E5F\u53EF\u76F4\u63A5\u4F7F\u7528.</p>
<h2 id="\u4FEE\u6539gist\u63D2\u4EF6\u914D\u7F6E" tabindex="-1">\u4FEE\u6539<code>Gist</code>\u63D2\u4EF6\u914D\u7F6E <a class="header-anchor" href="#\u4FEE\u6539gist\u63D2\u4EF6\u914D\u7F6E" aria-hidden="true">#</a></h2>
<p>\u901A\u8FC7<code>Preferences -&gt; Package Settings -&gt; Gist -&gt; Settings - User</code>\u6253\u5F00\u914D\u7F6E\u6587\u4EF6,\u7136\u540E\u5C06\u4E0A\u9762\u751F\u6210\u7684<code>Token</code>\u590D\u5236\u5230\u914D\u7F6E\u6587\u4EF6\u4E2D,\u5982\u4E0B:</p>
<div class="language-json"><pre><code><span class="token punctuation">{</span>
    <span class="token property">"token"</span><span class="token operator">:</span> <span class="token string">"xxxxxxxxxxxxxxxxxxxxxxx"</span>
<span class="token punctuation">}</span>
</code></pre>
</div><h2 id="\u5176\u5B83\u914D\u7F6E\u9879\u542B\u4E49" tabindex="-1">\u5176\u5B83\u914D\u7F6E\u9879\u542B\u4E49 <a class="header-anchor" href="#\u5176\u5B83\u914D\u7F6E\u9879\u542B\u4E49" aria-hidden="true">#</a></h2>
<div class="language-"><pre><code>{
	// token
	&quot;token&quot;: &quot;xxxxxxxxxxxxxxxxxxxxxxx&quot;,

	// Show GitHub organizations  ---  \u663E\u793A\u5728GIthub\u4E0A\u7684\u7EC4\u7EC7\u540D\u79F0?\u4E0D\u660E\u6240\u4EE5,\u56E0\u4E3A\u6211\u5728Gist\u9875\u9762\u4E0A\u6CA1\u770B\u5230\u8FD9\u4E2A\u5C5E\u6027\u6709\u5565\u7528,\u800C\u4E14\u5C45\u7136\u8FD8\u662F\u4E00\u4E2Alist
	// Example: &quot;company1&quot;, &quot;company2&quot;
	&quot;include_orgs&quot;: [],

	// Show GitHub users  ---  \u5148\u662F\u5728Github\u4E0A\u7684\u7528\u6237\u540D\u79F0?\u6BD4\u4E0A\u9762\u90A3\u4E2A\u66F4\u641E\u4E0D\u61C2\u7684,\u6709\u77E5\u9053\u8FD9\u4E24\u4E2A\u53C2\u6570\u7528\u5904\u7684\u9EBB\u70E6\u544A\u8BC9\u6211\u4E00\u4E0B,\u4E0D\u80DC\u611F\u6FC0~
	// Example: &quot;user1&quot;, &quot;user2&quot;
	&quot;include_users&quot;: [],

	// Show the authors of Gists  ---  \u662F\u5426\u663E\u793AGist\u7684\u4F5C\u8005~\u55EF,\u8C8C\u4F3C\u662F\u8FD9\u610F\u601D,\u4E0D\u8FC7\u540C\u6837\u6CA1\u770B\u5230\u5230\u5E95\u6709\u5565\u7528\u9014
	&quot;show_authors&quot;: false,

	// Prefer first file name instead of description in Open Gist menu
	&quot;prefer_filename&quot;: false,

	// Proxy server  ---  \u4EE3\u7406\u670D\u52A1\u5668\u8BBE\u7F6E~
	// Format: &quot;http://user:pass@proxy:port&quot; ---  \u4EE3\u7406\u670D\u52A1\u5668\u53C2\u6570\u7684\u683C\u5F0F
	&quot;https_proxy&quot;: &quot;&quot;,

	// Enterprise support  ---  \u4F01\u4E1A\u652F\u6301?\u597D\u5427,\u592A\u591A\u4E0D\u61C2\u7684\u73A9\u610F\u4E86(\u2299_\u2299)?,\u8DEF\u8FD8\u5F88\u957F~
	&quot;enterprise&quot;: false,
	// Github URL
	// Default: Leave empty if you want to use GitHub.com
	// Example: https://github.domain.com
	&quot;url&quot;: &quot;&quot;,

	// Max Gists to show (max 100 allowed by GitHub API)
	&quot;max_gists&quot;: 100,

	// Only use starred gists
	&quot;use_starred&quot;: false,

	// Disable the &quot;save file...&quot; dialog when closing a Gist
	&quot;supress_save_dialog&quot;: true,

	// Update the Gist upon saving the file, suppressing the filename dialog.
	&quot;save-update-hook&quot;: true

	// Limit to gists with specific prefix
	//&quot;gist_prefix&quot;: &quot;Snippet:&quot;,

	// Limit to gists with specific tag (#tag)
	//&quot;gist_tag&quot;: &quot;snippet&quot;
}
</code></pre>
</div><p>\u54C8\u54C8,\u5176\u5B9E\u6211\u53EA\u914D\u7F6E\u4E86\u4E00\u4E0B<code>token</code>\u5C31\u76F4\u63A5\u7528\u4E0A\u4E86,\u8FD9\u4E9B\u53C2\u6570\u5927\u90E8\u5206\u4E0D\u660E\u6240\u4EE5,\u540E\u9762\u82E5\u662F\u660E\u767D\u4E86\u518D\u6765\u66F4\u65B0.</p>
<h2 id="\u5FEB\u6377\u952E-\u529F\u80FD" tabindex="-1">\u5FEB\u6377\u952E&amp;\u529F\u80FD <a class="header-anchor" href="#\u5FEB\u6377\u952E-\u529F\u80FD" aria-hidden="true">#</a></h2>
<h3 id="\u521B\u5EFAgist" tabindex="-1">\u521B\u5EFA<code>Gist</code> <a class="header-anchor" href="#\u521B\u5EFAgist" aria-hidden="true">#</a></h3>
<p>\u9996\u5148\u5728<code>Sublime Text</code>\u521B\u5EFA\u4E00\u4E2A Gist \u6587\u4EF6,\u5982<code>log.js</code>,\u7136\u540E\u5C06\u5149\u6807\u653E\u5728\u6587\u4EF6\u4E2D\u5E76\u4F7F\u7528\u5FEB\u6377\u952E<code>Ctrl+K, Ctrl+I</code>\u6216\u547D\u4EE4<code>Gist: Create Public Gist</code>\u6765\u521B\u5EFA\u4E00\u4E2A<code>Public Gist</code>,\u4F1A\u5728<code>Sublime Text</code>\u4E0B\u65B9\u5F39\u51FA\u8F93\u5165\u6846,\u9996\u5148\u662F<code>Gist Description</code> --- <code>Gist</code>\u7684\u63CF\u8FF0\u4ECB\u7ECD,\u7136\u540E\u662F<code>Gist File Name</code> --- <code>Gist</code>\u7684\u6587\u4EF6\u540D,\u56DE\u8F66\u540E\u5C06\u4F1A\u5C06\u4F60\u5F53\u524D\u7684\u6587\u4EF6\u8F6C\u5316\u4E3A<code>Gist</code>\u5E76\u4E0A\u4F20\u5230<code>Github</code>.\u7136\u540E\u4F60\u5C31\u53EF\u4EE5\u6210\u529F\u5728<code>Github</code>\u4E2D\u770B\u5230\u4F60\u521A\u521A\u521B\u5EFA\u7684<code>Gist</code>\u4E86,\u54E6\u4E5F~</p>
<h3 id="\u6DFB\u52A0\u6587\u4EF6\u5230gist" tabindex="-1">\u6DFB\u52A0\u6587\u4EF6\u5230<code>Gist</code> <a class="header-anchor" href="#\u6DFB\u52A0\u6587\u4EF6\u5230gist" aria-hidden="true">#</a></h3>
<p>\u5728\u9700\u8981\u6DFB\u52A0\u7684\u6587\u4EF6\u4E2D\u4F7F\u7528\u5FEB\u6377\u952E<code>Ctrl+K, Ctrl+]</code>\u6216\u547D\u4EE4<code>Gist: Add File to Gist</code>,\u7136\u540E\u5728\u5F39\u51FA\u7684\u5217\u8868\u4E2D\u9009\u62E9\u9700\u8981\u6DFB\u52A0\u5230\u7684<code>Gist</code>.</p>
<h3 id="\u4F7F\u7528gist" tabindex="-1">\u4F7F\u7528<code>Gist</code> <a class="header-anchor" href="#\u4F7F\u7528gist" aria-hidden="true">#</a></h3>
<p>\u4F7F\u7528\u5FEB\u6377\u952E<code>Ctrl+K, Ctrl+[</code>\u6216\u547D\u4EE4<code>Gist: Insert Gist</code>\u6253\u5F00<code>Gist</code>\u5217\u8868,\u9009\u62E9\u9700\u8981\u63D2\u5165\u7684<code>Gist</code>\u6765\u63D2\u5165<code>(\u5C06\u4F1A\u63D2\u5165Gist\u4E2D\u6240\u6709\u6587\u4EF6\u7684\u5185\u5BB9)</code>.</p>
<h3 id="\u6253\u5F00gist" tabindex="-1">\u6253\u5F00<code>Gist</code> <a class="header-anchor" href="#\u6253\u5F00gist" aria-hidden="true">#</a></h3>
<p>\u4F7F\u7528\u5FEB\u6377\u952E<code>Ctrl+K, Ctrl+O</code>\u6216\u547D\u4EE4<code>Gist: Open Gist</code>\u6253\u5F00<code>Gist</code>\u5217\u8868,\u9009\u62E9\u9700\u8981\u6253\u5F00\u7684 Gist \u6765\u6253\u5F00.</p>
<h3 id="\u7F16\u8F91\u5220\u9664gist" tabindex="-1">\u7F16\u8F91\u5220\u9664<code>Gist</code> <a class="header-anchor" href="#\u7F16\u8F91\u5220\u9664gist" aria-hidden="true">#</a></h3>
<p>\u6253\u5F00\u4E00\u4E2A<code>Gist</code>\u540E,\u5728\u6253\u5F00\u7684<code>Gist</code>\u6587\u4EF6\u4E2D\u53EF\u4F7F\u7528<code>update</code>, <code>rename</code>, <code>delete</code>\u7B49\u64CD\u4F5C,\u4E0D\u591A\u8BF4.</p>
<h3 id="\u9875\u9762\u811A\u672C\u5F15\u7528" tabindex="-1">\u9875\u9762\u811A\u672C\u5F15\u7528 <a class="header-anchor" href="#\u9875\u9762\u811A\u672C\u5F15\u7528" aria-hidden="true">#</a></h3>
<p>\u4F7F\u7528\u547D\u4EE4<code>Embed as script</code>\u5C06\u4F1A\u521B\u5EFA\u4E00\u4E2A<code>javascript</code>\u5F15\u7528,\u53EF\u5728\u9875\u9762\u4E2D\u5C55\u793A<code>Gist</code>(\u542B\u4EE3\u7801\u9AD8\u4EAE\u6548\u679C\u54E6).</p>
<blockquote>
<p>\u7531\u4E8E\u8981\u4E0E<code>Github</code>\u670D\u52A1\u5668\u4EA4\u4E92,\u6240\u4EE5\u76F8\u5E94\u901F\u5EA6\u53EF\u80FD\u548C\u7F51\u7EDC\u6302\u94A9,\u5076\u5C14\u4F1A\u5F88\u6162(\u56FD\u5185\u7F51\u7EDC,\u4F60\u61C2\u5F97~)</p>
</blockquote>
`;export{t as __pageData,o as default};
